import React from 'react';
import { withFormik, Form, Field, ErrorMessage } from 'formik';
import * as Yup from 'yup';
import { API, Auth } from "aws-amplify"

import iconFacebook from '../img/facebook.svg';
import iconGoogle from '../img/google_plus.svg';
import * as PropTypes from "prop-types"
import config from "../../../config/constants.js"
import {withRouter} from "react-router-dom"

import './styles.scss';


// const schema = Yup.object().shape({
//     nome: Yup.string().required('Digite seu nome completo!'),
//     nascimento: Yup.date().required('Digite sua data de nascimento!'),
//     cpf: Yup.string().required('Digite seu CPF'),
//     email: Yup.string().required('Digite seu E-mail!'),
//     nickname: Yup.string().required('Digite seu nickname!'),
//     uf: Yup.string().required('Digite seu estado de origem!'),
//     cidade: Yup.string().required('Digite sua cidade!'),
//     bairro: Yup.string().required('Digite seu bairro!'),
//     rua: Yup.string().required('Digite sua rua!'),
//     numero: Yup.string().required('Digite o número da sua casa!'),
//     cep: Yup.string().length(8).required("Campo obrigatório")

// })

// const enhanceWithFormik = withFormik({
//     mapPropsToValues: () => ({ 
//         nome: '',
//         nascimento: '',
//         cpf: '', 
//         email: '',
//         nickname: '',
//         uf: '',
//         cidade: '',
//         bairro: '',
//         rua: '',
//         numero: '',
//         cep: '',
//         complemento: '',
//         codigo: '',
//     }),
//   handleSubmit: values => {
//     console.log(values)
//   },
//     isInitialValid: false,
//     validateOnChange: true,
//     validateOnBlur: true,
//     displayName: 'dadosUser',
//     validationSchema: schema
// })

const estados = ["AC", "AL", "AP", "AM", "BA", "CE", "DF", "ES", "GO", "MA", "MT", "MS",
  "MG", "PA", "PB", "PR", "PE", "PI", "RJ", "RN", "RS", "RO", "RR", "SC",
  "SP", "SE", "TO"];


function CadastroForm(props) {

    // state = {
    //     btn_disabled: true,
    //     btn_color: '#BBB',
    //     required: true
    // };

    // on_input (i) {
    //     const target = i.target;
    //     const habilitar = target.value.length;

    //     if (habilitar >= 8) {
    //         this.setState({ btn_disabled: false});
    //         this.setState({ btn_color: '#000'});
    //         this.setState({ required: false})
    //     } else {
    //         this.setState({ btn_disabled: true});
    //         this.setState({ btn_color: '#BBB'});
    //         this.setState({ required: true})
    //     }
    // }  

    // render() {
    //     return (
        <section className="telaCompleteCadastro">
            <div className="completeCadastro">
                <h3 className="titleH3">Complete seu cadastro</h3>
                <div className="redes-sociais">
                    <a href="#.com"><img className="facebook-icon" src={iconFacebook} alt="Icone Facebook" /></a> 
                    <a href="#.com"><img className="google-icon" src={iconGoogle} alt="Icone Google plus" /></a>
                </div>                 

                    <Form className="dadosPessoais">
                        <div className="blocoDadosPessoais">
                            <h3 className="titleH3">Dados pessoais</h3>
                            <ErrorMessage className="error" component="span" name="nome"/>
                            <fieldset>
                                <Field id="nome" type="text" name="nome" required/>
                                <label className="label" htmlFor="nome">Nome Completo</label>
                            </fieldset>
                            <ErrorMessage className="error" component="span" name="nascimento"/>
                            <ErrorMessage className="error" component="span" name="cpf"/>
                            <div className="doisCampos">
                                <fieldset>
                                    <Field id="nascimento" type="text" name="nascimento" required/>
                                    <label className="label" htmlFor="nascimento">Nascimento</label>
                                </fieldset>
                                <fieldset>              
                                    <Field id="cpf" type="text" name="cpf" required/>
                                    <label className="label" htmlFor="cpf">CPF</label>
                                </fieldset>
                            </div>
                            <ErrorMessage className="error" component="span" name="email"/>
                            <fieldset>
                                <Field id="email" type="text" name="email" required/>
                                <label className="label" htmlFor="email">E-mail</label>
                            </fieldset>
                            <ErrorMessage className="error" component="span" name="nickname"/>
                            <fieldset>   
                                <Field id="nickname" type="text" name="nickname" required/>
                                <label className="label" htmlFor="nickname">nickname</label>
                            </fieldset>
                        </div>

                        <div className="blocoEnderecoCompleto">
                            <h3 className="titleH3">Endereço completo</h3> 
                            <ErrorMessage className="error" component="span" name="uf"/>
                            <ErrorMessage className="error" component="span" name="cidade"/>
                            <div className="doisCampos">
                                <fieldset> 
                                    <select id="uf" name="uf" required>
                                    <option value="">UF</option>
                                        { estados.map((estado, index) => <option value={ estado } key={ index }>{ estado }</option>) }
                                    </select> 
                                    <label className="label" htmlFor="uf"/>
                                </fieldset>
                                <fieldset>
                                    <Field id="cidade" type="text" name="cidade" required/>
                                    <label className="label" htmlFor="cidade">Cidade</label>
                                </fieldset>
                            </div>

                            <ErrorMessage className="error" component="span" name="bairro"/>
                            <fieldset> 
                                <Field id="bairro" type="text" name="bairro" required/>
                                <label className="label" htmlFor="bairro">Bairro</label>
                            </fieldset>
                            <ErrorMessage className="error" component="span" name="rua"/>
                            <fieldset>
                                <Field id="rua" type="text" name="rua" required/>
                                <label className="label" htmlFor="rua">Rua</label>
                            </fieldset>
                            <ErrorMessage className="error" component="span" name="numero"/>
                            <ErrorMessage className="error" component="span" name="cep"/>
                            <div className="doisCampos">
                                <fieldset>
                                    <Field id="numero" type="text" name="numero" required/>
                                    <label className="label" htmlFor="numero">Numero</label>
                                </fieldset>
                                <fieldset>
                                    <Field id="cep" type="text" name="cep" onInput={this.on_input.bind(this)} required/>
                                    <label className="label" htmlFor="cep">CEP</label>
                                </fieldset>
                            </div>

                            <fieldset>
                                <Field id="complemento" type="text" name="complemento" required={this.state.required}/>
                                <label className="label" htmlFor="complemento">Complemento - <i>opcional</i></label>
                            </fieldset>
                        </div>

                        <div>
                            <h3 className="titleH3">Código Promocional</h3>
                            <fieldset>
